import { Dropdown } from "bootstrap";
import React, { useState } from "react";
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';



const Header = () => {

  const [query, setQuery] = useState('');

  const handleClickHome = (e) => {
    fetch('http://127.0.0.1:8000/', {
      method: 'GET',
      headers: {
        "Content-type": "application/json",
        Accept: 'application/json',
      },
    })
    .then(function(res) {
      return res.json();
    }).then(function(json) {
      console.log('Success: ', json);
      setQuery(json["data"]);
    })
    .catch(function(error) {
      console.log('Error: ', error);
    });
  };

  const handleClickFee = (e) => {
    fetch('http://127.0.0.1:8000/fee', {
      method: 'GET',
      headers: {
        "Content-type": "application/json",
        Accept: 'application/json',
      },
    })
    .then(function(res) {
      return res.json();
    }).then(function(json) {
      console.log('Success: ', json);
      setQuery(json["data"]);
    })
    .catch(function(error) {
      console.log('Error: ', error);
    });
  };

  const handleClickCabinet = (e) => {
    fetch('http://127.0.0.1:8000/fee', {
      method: 'GET',
      headers: {
        "Content-type": "application/json",
        Accept: 'application/json',
      },
    })
    .then(function(res) {
      return res.json();
    }).then(function(json) {
      console.log('Success: ', json);
      setQuery(json["data"]);
    })
    .catch(function(error) {
      console.log('Error: ', error);
    });
  };

  return (
    <>
    <Navbar bg="dark" data-bs-theme="dark" collapseOnSelect expand="lg" className="bg-body-tertiary">
    <Container>
      <Navbar.Brand href="#home">Логотип</Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link onClick={handleClickHome}>Главная</Nav.Link>
          <Nav.Link onClick={handleClickFee}>Fee</Nav.Link>
          <Nav.Link href="/schedule">Schedule</Nav.Link>
        </Nav>
        <Nav>
          <Dropdown label="Аккаунт" dismissOnClick={false}>
            <NavDropdown.Item>
              <Nav.Link onClick={handleClickCabinet}>Кабинет</Nav.Link>
            </NavDropdown.Item>
            <NavDropdown.Item>
            <Nav.Link onClick={handleClickGallery} eventKey={2} href="/gallery">Регистрация</Nav.Link>
            </NavDropdown.Item>
            <NavDropdown.Item>
            <Nav.Link onClick={handleClickCabinet} eventKey={2} href="/guides">Гайды</Nav.Link>
            </NavDropdown.Item>
          </Dropdown>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  <Container>{query}</Container>
  </>
  )
}

export default Header;
